import React, { useState } from "react";
import { createNewDog } from "../../redux/actions/index";

const FormPage = () => {
  const [formData, setFormData] = useState({
    name: "",
    minHeight: "",
    maxHeight: "",
    minWeight: "",
    maxWeight: "",
    life_span: "",
    temperaments: [],
  });

  const handleInputChange = (event) => {
    const { name, value } = event.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    // Aquí llamamos a la función creadaNewDogWithTemps con los datos del formulario
  };

  return (
    <form onSubmit={handleSubmit}>
      {/* Aquí agregamos los campos del formulario */}
      <label htmlFor="name">Nombre:</label>
      <input
        type="text"
        id="name"
        name="name"
        value={formData.name}
        onChange={handleInputChange}
        required
      />

      <label htmlFor="minHeight">Altura mínima:</label>
      <input
        type="number"
        id="minHeight"
        name="minHeight"
        value={formData.minHeight}
        onChange={handleInputChange}
        required
      />
      <label htmlFor="maxHeight">Altura máxima:</label>
      <input
        type="number"
        id="maxHeight"
        name="maxHeight"
        value={formData.maxHeight}
        onChange={handleInputChange}
        required
      />

      <label htmlFor="minWeight">Peso mínimo:</label>
      <input
        type="number"
        id="minWeight"
        name="minWeight"
        value={formData.minWeight}
        onChange={handleInputChange}
        required
      />
      <label htmlFor="maxWeight">Peso máximo:</label>
      <input
        type="number"
        id="maxWeight"
        name="maxWeight"
        value={formData.maxWeight}
        onChange={handleInputChange}
        required
      />

      <label htmlFor="life_span">Años de vida:</label>
      <input
        type="number"
        id="life_span"
        name="life_span"
        value={formData.life_span}
        onChange={handleInputChange}
        required
      />

      <label htmlFor="temperaments">Temperamentos:</label>
      <input
        type="text"
        id="temperaments"
        name="temperaments"
        value={formData.temperaments}
        onChange={handleInputChange}
        required
      />
    </form>
  );
};

export default FormPage;
